import React,{useState} from 'react'
import Form from './Form'
import ShortenLinks from './ShortenLinks'
const Section1 = () => {
	var [storage,setStorage]=useState()
	setStorage(localStorage.getItem('links')===null?[]:JSON.parse(localStorage.getItem('links')))
	console.log(storage)

	return (
		<section className="Section1">
			<Form/>
			<ShortenLinks/>
			{storage.map((a,b)=>{
			return <ShortenLinks url={a.url} shortenUrl={a.shortUrl}/>		
			})}
		</section>
	)
}

export default Section1
